import '../App.css';
import '../styles/signin.css'
import React from 'react';
import {
    Form,
    Input,
    InputNumber,
    Button,
    AutoComplete,
    Card
} from 'antd';
import {Link} from 'react-router-dom';
import Register from './register';
import store from '../store';
import actions from '../actions/Actions';
import { useSelector } from 'react-redux';


function Signin() {
    const loader = useSelector((state) => state.loader);

    const onFinish =(e) => {
        store.dispatch({
            type: actions.LOGIN_USER,
            payload: e
        })
    }

    return (
        <>
            <div className={'form-layout'}>
                < Card>
                <Form
                    name="signin"
                    onFinish={onFinish}
                    initialValues={''}
                    className={'sign-form'}
                    layout="vertical"
                    requiredMark={false}
                >
                    <Form.Item>
                        <p className={'title'}>
                            Welcome <br/>Keep your notes here!
                        </p>
                    </Form.Item>
                    <Form.Item
                        name="login"
                        label="Email"
                        rules={[
                            {
                                type: 'email',
                                message: 'The input is not valid E-mail!',
                            },
                            {
                                required: true,
                                message: 'Please input your E-mail!',
                            },
                        ]}
                    >
                        <Input  placeholder={'Email'} />
                    </Form.Item>

                    <Form.Item
                        name="password"
                        label="Password"
                        rules={[
                            {
                                required: true,
                                message: 'Please input your password!',
                            },
                        ]}
                        hasFeedback
                    >
                        <Input.Password   placeholder={'Password'}/>
                    </Form.Item>

                    <Form.Item >
                        <Button type="primary" htmlType="submit" loading= {loader} className={'sign-btn'}>
                            Signin
                        </Button>
                    </Form.Item>
                    <Form.Item className={'register-link'}>
                       Create account ? {' '} <Link to={'/Register'}>Register</Link>
                    </Form.Item>
                </Form>
                </Card>
            </div>
        </>
    );
}

export default Signin;
